import React, {Component} from 'react'
import Form from 'bootstrap/dist/css/bootstrap.min.css';

export class FederationForm extends Component {
  render(){
    return (
      <Form>
        <Form.Check
                type="switch"
                id="custom-switch"
                label="Check this switch"
              />
            </Form>
          )
    }
}

export default FederationForm;
